import React from "react";
import CardItem from "./CardItem";

const Card = (props) => {
  console.log(props);
  return (
    <div>
      {props.games.map((game) => {
        return (
          <CardItem
            game={game}
            foto={game.gamePhoto}
            name={game.gameName}
            key={game.id}
          />
        );
      })}
    </div>
  );
};

export default Card;
